					function Flatten_CUMULATIVE() {
						ret = {}
						function recurse(datas) {
							if(datas.length == 0) {
								return;
							}
							for(var i = 0; i < datas.length; ++i) {
								if(datas[i][0] in ret) {
									item = ret[datas[i][0]]
									item[0] += datas[i][1]
									item[1] += datas[i][2]
									item[2] += datas[i][3]
									item[3] += datas[i][4]
									item[4] += datas[i][5]
									item[5] += datas[i][6]
									item[6] += datas[i][7]
									item[7] += datas[i][8]
									item[8] += datas[i][9]
								}
								else {
									ret[datas[i][0]] = [
										datas[i][1],
										datas[i][2],
										datas[i][3],
										datas[i][4],
										datas[i][5],
										datas[i][6],
										datas[i][7],
										datas[i][8],
										datas[i][9]
									];
								}
								recurse(datas[i][10]);
